
const ROOMS = {"bedroom": "data:image/jpeg;base64,", "living": "data:image/jpeg;base64,", "gallery": "data:image/jpeg;base64,"};

// reference widths in inches (approx): queen bed 60in, sofa 84in, gallery span 144in
const ROOM_REFERENCES = {
  bedroom: { inches: 60, selector: '.room-stage[data-room=bedroom] img', widthPct: 0.52 }, // art center over bed, bed ~52% of image width
  living:  { inches: 84, selector: '.room-stage[data-room=living] img',  widthPct: 0.62 },
  gallery: { inches: 144, selector: '.room-stage[data-room=gallery] img', widthPct: 0.70 },
};

let state = {
  frame: 'black',
  size: '12x16',
  room: 'bedroom',
  artURL: null
};

// load rooms
for (const r of Object.keys(ROOMS)) {
  const img = new Image();
  img.src = ROOMS[r];
  document.querySelector(`.room-stage[data-room=${r}] .room-img`).src = img.src;
}

function setFrame(name) {
  state.frame = name;
  document.querySelectorAll('[data-frame]').forEach(b=>b.classList.toggle('active', b.dataset.frame===name));
  const frameURL = `assets/frames/${name}.svg`;
  document.querySelector('.frame-img').style.backgroundImage = `url('${frameURL}')`;
  document.querySelectorAll('.room-frame .frame-img').forEach(el=> el.style.backgroundImage = `url('${frameURL}')`);
}

function setSize(s) {
  state.size = s;
  document.querySelectorAll('[data-size]').forEach(b=>b.classList.toggle('active', b.dataset.size===s));
  updateRoomScale();
  document.getElementById('price').textContent = priceFor(s);
}

function priceFor(s) {
  const table = {'8x10':129,'12x16':199,'16x20':249,'18x24':299,'24x36':399};
  return '$'+(table[s]||199);
}

function updateRoomScale() {
  const [w,h] = state.size.split('x').map(n=>parseInt(n,10));
  const ref = ROOM_REFERENCES[state.room];
  const stage = document.querySelector(`.room-stage[data-room=${state.room}]`);
  const img = stage.querySelector('.room-img');
  const stageWidth = stage.clientWidth;
  // estimated bed/sofa width in pixels inside image
  const referencePixels = stageWidth * ref.widthPct;
  const scale = (w) / ref.inches; // fraction of reference width
  const frameCSSWidth = referencePixels * scale;
  const frameEl = stage.querySelector('.room-frame');
  frameEl.style.width = frameCSSWidth + 'px';
}

function setRoom(r) {
  state.room = r;
  document.querySelectorAll('[data-room-btn]').forEach(b=>b.classList.toggle('active', b.dataset.roomBtn===r));
  document.querySelectorAll('.room-stage').forEach(s=> s.style.display = (s.dataset.room===r)?'block':'none');
  updateRoomScale();
}

function onUpload(file) {
  const url = URL.createObjectURL(file);
  state.artURL = url;
  document.getElementById('artImage').src = url;
  document.querySelectorAll('.room-frame .frame-art img').forEach(el=> el.src = url);
}

document.getElementById('file').addEventListener('change', (e)=>{
  if(e.target.files[0]) onUpload(e.target.files[0]);
});

// init buttons
document.querySelectorAll('[data-frame]').forEach(b=> b.addEventListener('click', ()=> setFrame(b.dataset.frame)));
document.querySelectorAll('[data-size]').forEach(b=> b.addEventListener('click', ()=> setSize(b.dataset.size)));
document.querySelectorAll('[data-room-btn]').forEach(b=> b.addEventListener('click', ()=> setRoom(b.dataset.roomBtn)));

// default selections
setFrame('black');
setSize('12x16');
setRoom('bedroom');

window.addEventListener('resize', updateRoomScale);
